import React from 'react';
import backgroundImage from './young-handsome-physician-medical-robe-with-stethoscope.jpg'; 

function LandingPage() {
  return (
    <div className="docbackground" style={{ 
      backgroundImage: `url(${backgroundImage})`,
      height: '100vh',  // Set height to full viewport height
      width: '100%',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      display: 'flex',  // Use flexbox to align children
      flexDirection: 'column',  // Stack children vertically
      justifyContent: 'center',  
      alignItems: 'flex-start',  
      paddingLeft: '10%'  
    }}>
      <div>
        <h1 style={{ 
          fontSize: '80px',  // Increase font size of the title
          color: '#AB9551',  // Set color of the title
          margin: 0  // Remove default margin
        }}>
          Welcome to Our world <span>Oasis</span>
        </h1>
        <p style={{
          fontSize: '24px',  // Set a larger font size for the paragraph
          color: '#FFFFFF'  // Optionally, set a text color for visibility against the background
        }}>Explore and discover our services.</p>
      </div>
    </div>
  );
}

export default LandingPage;
